const Dump = props => (
  <div className="workContainer">
    <span className="artistName">
      {props.id}
      <img className="dumpHeart" src="/heart.svg" />
    </span>
    {props.children}
    <style jsx>{`
      .artistName {
        font-family: "Helvetica Neue", sans-serif;
        font-size: 0.8em;
        font-weight: 600;
        padding-right: 20px;
        position: relative;
      }
      .dumpHeart {
        position: absolute;
        width: 18px;
        top: 45%;
        right: 4px;
        transform: translatey(-60%);
        transition: all 0.2s ease-in-out;
        cursor: pointer;
      }
      .dumpHeart:hover {
        width: 23px;
      }
      .workContainer {
      }
    `}</style>
  </div>
);
export default Dump;
